-- This creation script should work in most flavors of SQL.
-- Logically, canonical_name is a primary key although no
-- constraint or index is included.
create table nicknames (
  canonical_name varchar(255),
  nickname_1 varchar(255),
  nickname_2 varchar(255),
  nickname_3 varchar(255),
  nickname_4 varchar(255),
  nickname_5 varchar(255),
  nickname_6 varchar(255),
  nickname_7 varchar(255),
  nickname_8 varchar(255),
  nickname_9 varchar(255),
  nickname_10 varchar(255),
  nickname_11 varchar(255),
  nickname_12 varchar(255),
  nickname_13 varchar(255),
  nickname_14 varchar(255),
  nickname_15 varchar(255)
);
-- These insert statements are verbose, but they could not be simpler to use.
